import os
import sys
import _thread
import winsound as snd

if "nt" != os.name:
	print("Only Allowed On Windows ;)")
	exit()

try:
	import tkinter as tk 
	from tkinter.filedialog import askdirectory as dirask
	import youtube_dl
	import pafy
except ImportError as e:
	try:
		print("Module Missing, Installing Needed Dependencies")
		os.system("pip install youtube_dl")
		os.system("pip install pafy")
		print("Modules Completed Downloading, Relaunch.")
		exit()
	except Exception as e:
		print("Unknown Error:")
		print("\n\n"+e,end="\n\n")
		exit()

# Methods


def PlayCheck(val,idd):
	try:
		pl = pafy.get_playlist("https://www.youtube.com/playlist?list="+str(idd))
		PlaylistCreated(val,pl)
		return True
	except Exception as e:
		PlaylistNotCreated(val)
		return False

def CheckPL(cl,pc):
	if pc:
		cl.configure(bg="#06FF06")
	else:
		PlaylistNotCreated(cl)
		cl.configure(bg="#FF4444")
		cl.bad = True

def IsBadOrNot(cl):
	if cl.bad:
		cl.configure(bg="#DDD")
		cl.bad = False

def PlaylistCreated(val,plist):
	val.ValLabel.configure(
		text="Playlist: "+str(plist["title"])+"\n\n"
	)
	val.DLButton.configure( 
		state="normal"
	)
	val.Playlist = plist
	pass

def PlaylistNotCreated(val):
	try:
		val.DLButton.configure(
			state="disabled"
		)
		val.ValLabel.configure(
			text="Please enter a valid Playlist ID\n\n"
		)
		val.Playlist = {}
	except:
		pass

def OnClickDL(self):
	direct = dirask()
	_thread.start_new_thread(DLAllFiles,(self,direct,self.Playlist))
	pass

def OnDoneDownloading(self):
	snd.PlaySound("SystemExclamation", snd.SND_ALIAS)
	self.ValLabel.configure(
		text="Finished Downloading!\n\n"
	)

def DLCallback(self,name,totalbytes,downloaded,ratio,rate,eta):
	self.Progbar.Inner.configure(
		width=ratio*360
	)
	self.ValLabel.configure(
		text="Downloading\n"+str(int(ratio*100))+"%\n"+name
	)

def DLAllFiles(self,dirr,listt):
	self.ValLabel.configure(
		text="Establishing Connection...\n\n"
	)
	self.DLButton.configure(
		state="disabled"
	)
	try:
		for l in listt["items"]:
			if not os.path.exists(dirr+"/"+l["playlist_meta"]["title"]+".mp4"):
				ls = l["pafy"].getbest()
				name = ls.download(filepath=dirr,quiet=True,callback=lambda a,b,c,d,e : DLCallback(self,l["playlist_meta"]["title"],a,b,c,d,e))
			else:
				self.ValLabel.configure(
					text="Skipping "+l["playlist_meta"]["title"]
				)	
		self.DLButton.configure(state="normal")
		OnDoneDownloading(self)
	except OSError:
		snd.PlaySound("SystemHand", snd.SND_ALIAS)
		self.ValLabel.configure(
			text="Data Cap Hit, Try again later\n\n"
		)
	except Exception as e:
		snd.PlaySound("SystemHand", snd.SND_ALIAS)
		self.ValLabel.configure(
			text="Unknown Error while Downloading\n\n"
		)
		print(e)



# GUI Class

class MainUI(tk.Frame):
	def __init__(self, master=None):
		super().__init__(master)
		self.master = master
		self.place(anchor="nw", width=500, height=300)
		self.configure(bd=5, bg="#333", width=500, height=700)
		self.Playlist = {}
		self.MakeWidgets()
	def MakeWidgets(self):

		# Creation
		self.EntryPanel = tk.Frame(self)
		self.Entry = tk.Entry(self.EntryPanel)
		self.ValLabel = tk.Label(self)
		self.Progbar = tk.Frame(self)
		self.Progbar.Inner = tk.Frame(self.Progbar)
		self.DLButton = tk.Button(self, cursor="@%s" % os.path.join(os.environ["WINDIR"], "Cursors/aero_link.cur").replace("\\", "/"))


		# Progbar
		self.Progbar.configure(
			bg="#212121",
			width=364,
			height=25,
			bd=1
		)

		self.Progbar.Inner.configure(
			bg="#444",
			width=360,
			height=21,
			bd=1
		)

		# Download Button
		self.DLButton.configure(
			width=40,
			height=50,
			bg="#232323",
			bd=0,
			text="Download",
			font="Bahnschrift 12 bold",
			fg="#DDD",
			state="disabled",
			command=lambda: OnClickDL(self)
		)

		# Label
		self.ValLabel.configure(font="Bahnschrift 12 bold",fg="#DDD",text="Enter a Playlist ID\n\n(www.youtube.com/playlist?list=IDHERE)",bg="#333")


		# Entry
		self.EntryPanel.configure(bg="#DDD")
		self.EntryPanel.bad = False
		self.Entry.bind("<Return>", lambda k: CheckPL(self.EntryPanel,PlayCheck(self,self.Entry.get()))) 
		self.Entry.bind("<Key>", lambda k: IsBadOrNot(self.EntryPanel)) 
		self.Entry.configure(bd=0,bg="#222222",width=40,font="Bahnschrift 12 bold",fg="#DDD",selectbackground="#444444",exportselection=0,insertbackground="#444444",justify="center")


		# Packing

		self.EntryPanel.pack(side="top", pady=20)
		self.Entry.pack(side="top",pady=1,padx=1)
		self.ValLabel.pack(side="top")
		self.Progbar.pack(side="top",padx=110,pady=10)
		self.Progbar.Inner.pack(side="left", pady=1,padx=1)
		self.DLButton.pack(side="top",pady=10)



